INSERT INTO `wp_options` VALUES (568,'yp_live_view_css_data','/* Masthead */\n#masthead{\r	min-height:149px;\r	height:149px;\r}\r\r/* Link */\n.site-branding .site-title a{\r	display:none;\r}\r\r/* Heading */\n.error-404 .page-header h1{\r	display:none;\r}\r\r/* Paragraph */\n.error-404 p{\r	display:none;\r}\r\r/* Widget */\n.error-404 section .widget{\r	display:none;\r}\r\r/* Division */\n#content .col-full{\r	display:none;\r}\r\r/* Site info */\n#colophon .col-full .site-info{\r	display:none;\r}\r\r#page .storefront-breadcrumb{\r	display:none;\r}\r\r/* Input */\n#masthead .widget input[type=search]{\r	display:none;\r}\r\r/* Form Division */\n#masthead .widget form{\r	display:none;\r}\r\r/* Link */\n#masthead .nav-menu li a{\r	margin-top:0px !important;\r}\r\r/* Link */\n.nav-menu li a{\r	margin-left:20px !important;\r	position:relative;\r	animation-fill-mode:both;\r	animation-timing-function:ease-in-out;\r}\r\r/* Link (hover) */\n.nav-menu li a.yp_hover{\r	animation-duration:1s;\r	animation-delay:0s;\r}\r\r@media (min-width:768px){\r\r	/* Link */\n	#site-header-cart li a{\r		display:none;\r	}\r	\r	/* Link */\n	.nav-menu li a{\r		padding-left:28px !important;\r	}\r	\r}','yes');
